import React from 'react';

function Contact() 
{
    return (
        <div>
            <h2>Contato</h2>
            <p>Endereço: R. Contos Gauchescos, 165 - Vila Santa Catarina, São Paulo - SP, 04369-000</p>
            <p>Email: contato@taximichelines.com.br</p>
            <p>Telefone: (11) 5555-1234</p>
        </div>
    );
}

export default Contact;
